import React, { useState } from 'react';

function TestResultsDashboard({ summary = {} }) {
  const {
    total = 0,
    passed = 0,
    failed = 0,
    duration = '—',
    languageBreakdown = []
  } = summary;

  const passRate = total > 0 ? ((passed / total) * 100).toFixed(2) : '0.00';

  return (
    <div className="grid grid-cols-1 md:grid-cols-2 gap-6 p-6">
      {/* Test Summary */}
      <div className="bg-white rounded-2xl shadow-lg p-6 border border-gray-200">
        <h2 className="text-2xl font-semibold mb-4 text-gray-800 flex items-center">
          📊 Test Summary
        </h2>
        <div className="grid gap-4 text-gray-700 text-lg">
          <div className="flex justify-between">
            <span>✅ <strong>Total Tests Run:</strong></span>
            <span>{total}</span>
          </div>
          <div className="flex justify-between">
            <span>🟢 <strong>Passed:</strong></span>
            <span>{passed}</span>
          </div>
          <div className="flex justify-between">
            <span>🔴 <strong>Failed:</strong></span>
            <span>{failed}</span>
          </div>
          <div className="flex justify-between">
            <span>📈 <strong>Pass Rate:</strong></span>
            <span>{passRate}%</span>
          </div>
          <div className="flex justify-between">
            <span>⏱️ <strong>Execution Time:</strong></span>
            <span>{duration}</span>
          </div>
        </div>
      </div>

      {/* Language Breakdown */}
      <div className="bg-white rounded-2xl shadow-lg p-6 border border-gray-200">
        <h2 className="text-2xl font-semibold mb-4 text-gray-800 flex items-center">
          🧪 Test Breakdown by Language
        </h2>
        {languageBreakdown.length > 0 ? (
          <ul className="space-y-3 text-lg text-gray-700">
            {languageBreakdown.map((lang, idx) => (
              <li key={idx} className="flex justify-between border-b pb-1">
                <span>{lang.name}</span>
                <span>{lang.total} tests – {lang.passRate}% pass</span>
              </li>
            ))}
          </ul>
        ) : (
          <p className="text-gray-500 italic">No language data available.</p>
        )}
      </div>
    </div>
  );
}

// Sample Data
const summaryData = {
  Java: {
    total: 800,
    passed: 799,
    failed: 1,
    duration: '5 min 30 sec',
    languageBreakdown: [{ name: 'Java', total: 800, passRate: 99.88 }]
  },
  Python: {
    total: 500,
    passed: 450,
    failed: 50,
    duration: '3 min 20 sec',
    languageBreakdown: [{ name: 'Python', total: 500, passRate: 90.00 }]
  },
  '.NET': {
    total: 300,
    passed: 270,
    failed: 30,
    duration: '2 min 45 sec',
    languageBreakdown: [{ name: '.NET', total: 300, passRate: 90.00 }]
  }
};

export default function App() {
  const [selectedLang, setSelectedLang] = useState('Java');
  const handleChange = (e) => setSelectedLang(e.target.value);

  return (
    <div className="p-6">
      <div className="mb-4">
        <label htmlFor="language-select" className="text-lg font-medium text-gray-700 mr-2">
          Select Language:
        </label>
        <select
          id="language-select"
          value={selectedLang}
          onChange={handleChange}
          className="border border-gray-300 rounded-lg p-2"
        >
          <option value="Java">Java</option>
          <option value="Python">Python</option>
          <option value=".NET">.NET</option>
        </select>
      </div>
      <TestResultsDashboard summary={summaryData[selectedLang]} />
    </div>
  );
}
